import React, { useState, useEffect } from 'react';
import { useAuth } from '../context/AuthContext';
import './Schedule.css';

const Schedule = () => {
  const { currentUser } = useAuth();
  const [workouts, setWorkouts] = useState([]);
  const [selectedDate, setSelectedDate] = useState(new Date().toISOString().split('T')[0]);

  useEffect(() => {
    // Load saved workouts from localStorage
    const savedWorkouts = localStorage.getItem('workouts');
    if (savedWorkouts) {
      setWorkouts(JSON.parse(savedWorkouts));
    }
  }, []);

  const handleSignup = (workoutId) => {
    if (!currentUser) {
      alert('Please log in to sign up for workouts');
      return;
    }

    const updatedWorkouts = workouts.map(workout => {
      if (workout.id === workoutId) {
        const isSignedUp = workout.participants.includes(currentUser.id);
        if (isSignedUp) {
          // Remove user from participants
          return {
            ...workout,
            participants: workout.participants.filter(id => id !== currentUser.id)
          };
        } else {
          // Add user to participants
          return {
            ...workout,
            participants: [...workout.participants, currentUser.id]
          };
        }
      }
      return workout;
    });

    setWorkouts(updatedWorkouts);
    localStorage.setItem('workouts', JSON.stringify(updatedWorkouts));
  };

  const isSignedUp = (workoutId) => {
    if (!currentUser) return false;
    const workout = workouts.find(w => w.id === workoutId);
    return workout && workout.participants.includes(currentUser.id);
  };

  const filteredWorkouts = workouts.filter(workout => 
    workout.date === selectedDate
  );

  return (
    <div className="schedule-container">
      <div className="container">
        <h1 className="section-title">Workout Schedule</h1>
        <p className="section-subtitle">Sign up for team workouts and training sessions</p>

        {/* Date Selector */}
        <div className="date-selector">
          <label htmlFor="date">Select Date:</label>
          <input
            type="date"
            id="date"
            value={selectedDate}
            onChange={(e) => setSelectedDate(e.target.value)}
            min={new Date().toISOString().split('T')[0]}
          />
        </div>

        {/* Workouts List */}
        <div className="workouts-list">
          {filteredWorkouts.length === 0 ? (
            <div className="no-workouts">
              <p>No workouts scheduled for this date.</p>
              {currentUser && (
                <p>Check back later or ask your coach to add workouts!</p>
              )}
            </div>
          ) : (
            filteredWorkouts.map(workout => (
              <div key={workout.id} className="workout-card">
                <div className="workout-header">
                  <div className="workout-time">
                    <span className="time">{workout.time}</span>
                    <span className="duration">{workout.duration}</span>
                  </div>
                  <div className="workout-type">
                    <span className={`type-badge ${workout.type.toLowerCase()}`}>
                      {workout.type}
                    </span>
                  </div>
                </div>

                <div className="workout-details">
                  <h3>{workout.title}</h3>
                  <p>{workout.description}</p>
                  <div className="workout-info">
                    <span>📍 {workout.location}</span>
                    <span>👥 {workout.participants.length}/{workout.maxParticipants} participants</span>
                  </div>
                </div>

                <div className="workout-actions">
                  {currentUser ? (
                    <button
                      onClick={() => handleSignup(workout.id)}
                      className={`signup-btn ${isSignedUp(workout.id) ? 'signed-up' : ''}`}
                    >
                      {isSignedUp(workout.id) ? '✓ Signed Up' : 'Sign Up'}
                    </button>
                  ) : (
                    <button className="signup-btn disabled" disabled>
                      Login to Sign Up
                    </button>
                  )}
                </div>
              </div>
            ))
          )}
        </div>

        {/* Sample Workouts for Demo */}
        {workouts.length === 0 && (
          <div className="demo-workouts">
            <h3>Sample Workouts (Demo)</h3>
            <p>These are sample workouts to show how the schedule works. In a real app, coaches would add actual workouts.</p>
            <div className="workout-card demo">
              <div className="workout-header">
                <div className="workout-time">
                  <span className="time">6:00 AM</span>
                  <span className="duration">1h 30m</span>
                </div>
                <div className="workout-type">
                  <span className="type-badge swim">Swim</span>
                </div>
              </div>

              <div className="workout-details">
                <h3>Morning Swim Session</h3>
                <p>Focus on technique and endurance. Bring fins and paddles.</p>
                <div className="workout-info">
                  <span>📍 UofT Athletic Centre Pool</span>
                  <span>👥 0/20 participants</span>
                </div>
              </div>

              <div className="workout-actions">
                <button className="signup-btn disabled" disabled>
                  Demo Mode
                </button>
              </div>
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default Schedule;
